/**
 * A position with x, y and facing properties.
 *
 * @example
 * var position = new Position(1, 2, Position.SOUTH);
 *
 * position.left().facing; // 'east'
 * position.right().facing; // 'west'
 * position.forward().y; // 1
 */
export default class Position {

  static get NORTH() {
    return 'north';
  }

  static get EAST() {
    return 'east';
  }

  static get SOUTH() {
    return 'south';
  }

  static get WEST() {
    return 'west';
  }

  /**
   * @param {number} x
   * @param {number} y
   * @param {string} [facing='north']
   */
  constructor(x, y, facing) {

    this._x = ~~x;
    this._y = ~~y;

    facing = facing || Position.NORTH;

    switch (facing.toLowerCase()) {
      case Position.NORTH:
        this._facing = Position.NORTH;
        break;
      case Position.EAST:
        this._facing = Position.EAST;
        break;
      case Position.SOUTH:
        this._facing = Position.SOUTH;
        break;
      case Position.WEST:
        this._facing = Position.WEST;
        break;
      default:
        throw new Error(`Unknown facing '${facing}'`);
    }

  }

  /** @type {number} */
  get x() {
    return this._x;
  }

  /** @type {number} */
  get y() {
    return this._y;
  }

  /**
   * The direction the position is facing. One of 'north', 'east', 'south' or 'west'.
   *
   * @type {string}
   */
  get facing() {
    return this._facing;
  }

  /**
   * Returns a new position that is in front of this position.
   *
   * @return {Position}
   */
  forward() {
    switch (this._facing) {
      case Position.NORTH:
        return new Position(this._x, this._y + 1, this._facing);
      case Position.EAST:
        return new Position(this._x + 1, this._y, this._facing);
      case Position.SOUTH:
        return new Position(this._x, this._y - 1, this._facing);
      case Position.WEST:
        return new Position(this._x - 1, this._y, this._facing);
      default:
    }
  }

  /**
   * Returns a new position at the same location with the facing rotated left.
   *
   * @return {Position}
   */
  left() {
    switch (this._facing) {
      case Position.NORTH:
        return new Position(this._x, this._y, Position.WEST);
      case Position.EAST:
        return new Position(this._x, this._y, Position.NORTH);
      case Position.SOUTH:
        return new Position(this._x, this._y, Position.EAST);
      case Position.WEST:
        return new Position(this._x, this._y, Position.SOUTH);
      default:
    }
  }

  /**
   * Returns a with the position's x, y and facing like this: '2,1,NORTH'
   *
   * @return {string}
   */
  report() {
    return [this._x, this._y, this._facing.toUpperCase()].join(',');
  }

  /**
   * Returns a new position at the same location with the facing rotated right.
   *
   * @return {Position}
   */
  right() {
    switch (this._facing) {
      case Position.NORTH:
        return new Position(this._x, this._y, Position.EAST);
      case Position.EAST:
        return new Position(this._x, this._y, Position.SOUTH);
      case Position.SOUTH:
        return new Position(this._x, this._y, Position.WEST);
      case Position.WEST:
        return new Position(this._x, this._y, Position.NORTH);
      default:
    }
  }

}

/**
 * A robot that can be moved around a table.
 *
 * @example
 * var table = new Table(5, 5);
 * var robot = new Robot(table);
 * var position = new Position(2, 2, Position.EAST);
 *
 * robot.place(position); // places the robot on the table
 * robot.move(); // moves the robot forward
 * robot.left(); // rotates the robot left
 * robot.right(); // rotates the robot right
 */
export default class Robot {

  constructor(table) {
    this._table = table;
    this._position = null;
  }

  /**
   * The current position of the robot. If the robot has not been placed on the
   * table this will be null.
   *
   * @type {Position}
   */
  get position() {
    return this._position;
  }

  /**
   * Rotates the robot left. Ignored if the robot has not been placed on the table.
   */
  left() {
    if (this._position) {
      this._position = this._position.left();
    }
  }

  /**
   * Moves the robot forward if the position in front is valid. Ignored if the
   * robot has not been placed on the table.
   */
  move() {

    if (this._position) {

      let newPosition = this._position.forward();

      if (this._table.isValid(newPosition)) {
        this._position = newPosition;
      }

    }

  }

  /**
   * Places the robot on the table at the position given, if the position is valid.
   * @param {Position} position - The position to attempt to place the robot at.
   */
  place(position) {
    if (this._table.isValid(position)) {
      this._position = position;
    }
  }

  /**
   * Rotates the robot right. Ignored if the robot has not been placed on the table.
   */
  right() {
    if (this._position) {
      this._position = this._position.right();
    }
  }

}

