import Position from './position';
import Robot from './robot';
import Table from './table';

/**
 * Simulates moving a toy robot on a 5x5 table.
 *
 * Note: The 0,0 coordinate is in the south-west corner.
 *
 * @example
 * var simulator = new Simulator();
 *
 * simulator.exec('PLACE 1,2,NORTH'); // ''
 * simulator.exec('MOVE'); // ''
 * simulator.exec('REPORT'); // '1,3,NORTH'
 */
export default class Simulator {

  constructor() {
    this._table = new Table(5, 5);
    this._robot = new Robot(this._table);
  }

  /**
   * Parses the given order and gives the instruction to the robot.
   *
   * @param {string} order - The order to execute.
   * @return {string} - Result of the order (every order except the 'report' order returns an empty string).
   */
  exec(order) {

    let { type, options } = this._parseOrder(order);
    let output = '';

    switch (type) {
      case 'PLACE':
        let [x, y, facing] = options;
        this._robot.place(new Position(x, y, facing));
        break;
      case 'MOVE':
        this._robot.move();
        break;
      case 'LEFT':
        this._robot.left();
        break;
      case 'RIGHT':
        this._robot.right();
        break;
      case 'REPORT':
        if (this._robot.position) {
          output = this._robot.position.report();
        }
        break;
      case '':
        break;
      default:
        throw new Error('Unknown order:', type);
    }

    return output;

  }

  /**
   * Takes an order string and returns an order object.
   *
   * @example
   * simulator._parseOrder(' place 2,1,NOrTH'); // { type: 'PLACE', options: ['2', '1', 'NORTH'] }
   * simulator._parseOrder('MOVE'); // { type: 'MOVE', options: [] }
   *
   * @param {string} order - The order to be parsed.
   * @return {Object} The parsed order.
   * @property {string} type - The order type.
   * @property {string[]} options - Options for the order.
   */
  _parseOrder(order) {

    order = order.trim().toUpperCase();

    let index = order.indexOf(' ');

    if (index === -1) {
      return {
        type: order,
        options: []
      };
    } else {
      return {
        type: order.slice(0, index).trim(),
        options: order.slice(index).trim().split(',').map(x => x.trim())
      };
    }

  }

}

/**
 * A table that has a fixed width and height.
 *
 * @example
 * var table = new Table(2, 5);
 * var position = new Position(10, 10);
 *
 * table.width; // 2
 * table.height; // 5
 * table.isValid(position); // false
 */
export default class Table {

  /**
   * @param {number} width
   * @param {number} height
   */
  constructor(width, height) {

    if (arguments.length < 2) {
      throw new Error('You must provide and width and height.');
    }

    width = ~~width;
    height = ~~height;

    if (width <= 0) {
      throw new Error('The width must be greater than 0.');
    }

    if (height <= 0) {
      throw new Error('The height must be greater than 0.');
    }

    this._width = ~~width;
    this._height = ~~height;

  }

  /** @type {number} */
  get height() {
    return this._height;
  }

  /** @type {number} */
  get width() {
    return this._width;
  }

  /**
   * Checks if the given position is within the bounds of the table and a valid
   * location to place an object.
   *
   * @param {Position} p - The position to check. The facing information in not used.
   * @return {boolean} - Returns true if the position is valid.
   */
  isValid(p) {
    return p.x >= 0 && p.x < this._width && p.y >= 0 && p.y < this._height;
  }

}

